import React from 'react';
import PropTypes from 'prop-types';
import classNames from 'classnames';
import Logo from './partials/Logo';
import FooterNav from './partials/FooterNav';
import FooterSocial from './partials/FooterSocial';

const propTypes = {
	topOuterDivider: PropTypes.bool,
	topDivider: PropTypes.bool
};

const defaultProps = {
	topOuterDivider: false,
	topDivider: false
};

const Footer = ({ className, topOuterDivider, topDivider, ...props }) => {
	const classes = classNames('site-footer center-content-mobile', topOuterDivider && 'has-top-divider', className);

	return (
		<footer {...props} className={classes}>
			<div className="container">
				<div class="row">
					<div class="col-1-of-3">Col 1 of 3</div>
					<div class="col-2-of-3">
						Johnny Depp Anonymous original content is copyright 2020 by Justin Wozniak. This fansite has no
						official affiliation with Johnny Depp, his family or management. No copyright infringement is
						intended: images and articles are used without permission and are copyright of their respective
						owners.
					</div>
				</div>
			</div>
		</footer>
	);
};

Footer.propTypes = propTypes;
Footer.defaultProps = defaultProps;

export default Footer;
